Here's a small and barebones minecraft clone to provide as an example of real applications using Dojo as we explain the basic boilerplate code to append to your models and entities to make them work with Katana and Torii: models/components.cairo // All models supported in the game and stored onchain. #[derive(Drop, Clone, Serde, PartialEq, Debug)]
#[dojo::model]
struct Character { #[key] m_ent_player_addr: ContractAddress, // Who this character belongs to. m_alias: ByteArray, // The name that they have chosen to display to others. m_player_index: u8 // The nth player in the world.
} #[derive(Drop, Clone, Serde, PartialEq, Debug)]
#[dojo::model]
struct Inventory { #[key] m_ent_player_addr: ContractAddress, m_size: u32, m_stack_limit: u32, m_items: Array<BlockType>
} #[derive(Drop, Clone, Serde, PartialEq, Debug)]
#[dojo::model]
struct Hotbar { #[key] m_ent_inventory_addr: ContractAddress, m_items: Array<BlockType>
} #[derive(Drop, Copy, Serde, PartialEq, Debug, Introspect)]
enum BlockType { Grass: (), Wood: (), Water: (), Stone: (), Ore: OreType // etc...
} #[derive(Drop, Copy, Serde, PartialEq, Debug, Introspect)]
enum OreType { Diamond, Gold, Iron, Coal // etc...
} // And way more...

