First up, just like a typical Cairo contract, you need to set up your contract interface: // All the systems relevant to the minecraft example world // used in the previous code snippets #[dojo::interface]
trait IWhatever { // Add your trait functions here...
} The #[dojo::interface] acts very much like the #[starknet::interface], the only difference seems to be that the former has IWorldDIspatcher defined, making it possible for systems defined within the interface block to use the world as a parameter.

