In Dojo, write contracts are just regular systems that can mutate the world by setting some models to a new state onchain. // By default, a system will be one able to write and mutate the world, it is // essentially an invoke transaction on the selector 'get_character_name'
fn set_character_name(ref world: IWorldDispatcher, new_name: ByteArray) { let caller = get_caller_address(); // Get the current character that we want to mutate. let mut character = get!(world, (caller), (Character)); // Making sure that the caller has a character. assert!(*character.m_name != "", "Character not found"); character.m_name = new_name; set!(world, (character)); // We set the new state of the character model in our world
} If you are confused about the set!() macro and it's usage here, refer to the macros section.

8.body:
The macro get!() is a builtin macro provided by #[dojo::contract], and allows us to fetch the model Character associated with the entity caller , which is just a typical Starknet contract address. The reason why caller and Character are between parentheses, is due to how Dojo's get!() macro expects entities and models. It requires that both the keys (entity) and the models passed be in tuples You can also fetch multiple models against an entity: // Get both character and inventory models for the caller at the same time.
// Note that this will ONLY work if BOTH Character and Inventory have the SAME
// primary key type (contractAddress).
let (character, inventory) = get!(world, (caller), (Character, Inventory));

