The macro set!() is a builtin macro provided by #[dojo::contract], and allows us to write the model Character and Inventory associated with the entity caller . Note that the set!() macro does not need the model types in a separate tuple to be provided in the call arguments. You can also set multiple models at once: // By default, a system will be one able to write and mutate the world, it is // essentially an invoke transaction on the selector 'get_character_name'
fn set_character_name(ref world: IWorldDispatcher, new_name: ByteArray) { let caller = get_caller_address(); // Get the current character that we want to mutate. let mut character = get!(world, (caller), (Character)); // Making sure that the caller has a character. assert!(*character.m_name != "", "Character not found"); character.m_name = new_name; set!(world, (character)); // We set the new state of the character model in our world
} Notice how we don't have to specify the model types ? The set!() macro allows us to only provide the modified model instance, in any order as we want this time, regardless of how many different model instances we give it, as long as the model instances' types are valid dojo models .
